import React from "react";
import { Card } from "react-bootstrap";

const dataClient = [
    {
        name:"Nash Patrik",
        designation:"CEO Manpol",
        test: "Lorem, ipsum dolor sit amet consectetur adipisicing elit. Labore, quia?"
    },
    {
        name:"Jos Baiden",
        designation:"CEO Manpol",
        test: "Lorem, ipsum dolor sit amet consectetur adipisicing elit. Labore, quia?"
    },
    {
        name:"Donal Trump",
        designation:"CEO Manpol",
        test: "Lorem, ipsum dolor sit amet consectetur adipisicing elit. Labore, quia?"
    }


]

const Clients = () => {
  return (
    <div>
      {
          dataClient.map(client => <Card style={{ width: "18rem" }}>

<div className="d-flex">
<Card.Img variant="top" src="holder.js/100px180" roundedCircle />
<Card.Title>{client.name}</Card.Title>
</div>
          <Card.Body>
            

            <Card.Text>
              {client.text}
            </Card.Text>
          </Card.Body>
        </Card>
        
        )
      }
    </div>
  );
};

export default Clients;
